                        img:'https://picsum.photos/id/62/200/300', 
                        alt:'pic-empolyee-3',
                        website: 'www.raouf-alim.dz',
                        mobile: '+213554959280',
                    }
                }
                />
            </div>
            <div className="row">
            <EmpolyerItem 
                className='col-md-4 col-sm-6'
                p = {
                    {
                        name:'MEHDI',
