                />
            
            <EmpolyerItem 
                className='col-md-4 col-sm-6'
                p = {
                    {
                        name:'ABDEALI',
                        nick:'GHERDIS', 
                        role:'Web Developer', 
                        img:'https://picsum.photos/id/64/200/300', 
                        alt:'pic-empolyee-5',
                        Email: 'a_gherdis@esi.dz',
                        mobile: '+2137798258962',
                    }
                }
                />
            
            <EmpolyerItem 
                className='col-md-4 col-sm-6'
                p = {
                    {
                        name:'Zakaria',
                        nick:'KHERBANENE', 
                        role:'Designer', 
                        img:'https://picsum.photos/id/65/200/300', 
                        alt:'pic-empolyee-6',
                        Email: 'kherbanene822@gmail.com',
                        mobile: '+21377912021',
                    }
                }
                />
            </div>
        </div>
    )
}
export default Empolyer
